        };
        let ref = React.createRef();
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(){
        this.setState((prevState)=>{
            return ({menuIsOpen: !prevState.menuIsOpen})
        })
    }

    render() {

        return (
            <Fragment>

            </Fragment>
        )
    }
}


